import Countries from './Countries'
export default function SearchBox(props) {
    
   

let list=props.filtered.map((country)=>{
    return <Countries countries={country} key={country.Country}/>
})



    

    return (
      
        <div className="container">

         <input type="text" className="form-control" placeholder="Search Country By Name"  onChange={props.onInputchange}/>
       {list}
        </div>
     
    )
}
